    true,nt"url": null,nt"notes": "This dataset brings together information
    collected since 2001 on PPPs that have been supported by USAID. For the purposes
    of this dataset a Public-Private Partnership is defined as a USAID-supported development
    project or initiative which engages the private sector (including corporations,
    foundations, and other non-governmental actors) as a core resource partner. Due
    to changes in Agency data collection systems, standards, and internal organization,
    the data has been collected according to different mechanisms, definitions, and
    timeframes from 2001-2015, and therefore cannot be considered to be comprehensive
    of all PPPs during this period.",nt"license_title": "Other License Specified",nt"extras":
